/* Source: https://codemyui.com/switch-between-mason-grid-and-slider-view/ */
import React, { Component } from 'react';

import '../Assets/css/gridstyle.css'

class Grid extends Component {
  constructor(props) {
    super(props);
    this.state = {
      grid: true,
    }
  }
  // componentDidMount() {
  //   const script = document.createElement('script');
  //   script.src = "./gridwork.js"
  //   script.async = true;
  //   document.body.appendChild(script);
  //   alert("appended")
  // };
  handleClick(target) {
    // alert("clicked")
    switch(target) {
      case "grid":
        this.setState({
          grid: true,
        })
        break;
      case "carousel":
        this.setState({
          grid: false,
        })
    }
  }

  render() {
    // useEffect(() => {
    //   const script = document.createElement('script');
    //   script.src = "./gridwork.js"
    //   script.async = true;
    //   document.body.appendChild(script);

    //   return () => {
    //     document.body.removeChild(script);
    //   }
    // });

    const renderGallery = () => {
      return (
        <div className="thumbs">  
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
              <p>
                  <span></span>
                  <span className="short"></span>
              </p>
          </div>
      );
    }


    const renderGrid = () => {
      return (
        <div id="grid">
          <div id="grid-selector">
              <div id="viewCarousel" onClick={() => this.handleClick("carousel")} className={!this.state.grid ? "active" : null}></div>
              <div id="viewGrid" onClick={() => this.handleClick("grid")} className={this.state.grid ? "active" : null}>
                <p></p>
                <p></p>
                <p></p>
                <p></p>            
              </div>        
          </div>

          <div id="headline">
              <p></p>
              <p className="short"></p>
          </div>

          {renderGallery()}

          <div id="carousel">
              <div className="innerCarousel">
                  <div>

                  </div>
                  <div>
                      <p className="current">
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
                  <div>    
                      <p>
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
                  <div>    
                      <p>
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
                  <div>
                      <p>
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
                  <div>    
                      <p>
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
                  <div>    
                      <p>
                          <span></span>
                          <span className="short"></span>
                      </p>
                  </div>
              </div>
          </div>
          <script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.2/jquery.min.js"></script>
        </div>
      );
    }
    return (
        renderGrid()
    );
  }
}

export default Grid;
